     <AppBar position="fixed" color="primary" elevation="0" className="a1 ">
        <Toolbar>
          <IconButton edge="start"  color="inherit" aria-label="menu">
            
          </IconButton>
          <Typography variant="h6" >
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
        
        <style jsx>{`
          .a1{
            margin-bottom: 0;
            background-color: #fff;        
          }
          .a2{
            padding: 0;
          }
         
        `}</style>
    </div>)
}

export default about;
